description:
                                    Описание от продавца                            
Продаю пентхаус! 

200 кв. метров плюс 25 кв.метра остекленная и утепленная терраса.

Дом кирпичный;
Центральное отопление;
Газ;
Гараж на одну автомашину;
Кладовка в подвале;

Три спальни;
Кухня-столовая - 33 кв.метра;
Большая гостиная - 53 кв. метра;
Кабинет;
Терраса;
Три санузла.

Материалы: 
Полы - мрамор и дубовый паркет;
Мебель - дерево;
Подоконники - гранит;
Двери и лестница - комбинированное дерево;

Дом находится в районе филармонии. В шаговой доступности, в 3-5 минутах ходьбы от дома находятся: школа №2, мэрия Бишкека, торговые центры "I-MaLL", "Bishkek Park", "Beta Storis-1", гипермаркеты "Фрунзе" и "Globus", фитнес центр "Maximum", чайхана "Navat" и многое другое.
